import React from "react";

import './index.scss'
import slideData from "../../config/slideData";

export default function SlideList() {
  return (
    <div className="slideList">
      {slideData.map((img, idx) => {
        return <div>
          <img width={600} src={img} alt="nosource" />
        </div>;
      })}
    </div>
  );
}
